CREATE TABLE `conceptos` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `empleado_id` int(11) NOT NULL,
  `usuario_pago_id` int(11) DEFAULT NULL COMMENT 'Usuario y hoja de asistencia a la que pertenece',
  `importe` varchar(50) NOT NULL,
  `comentarios` text,
  `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '0 => Pendiente, 1 => Atendido',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `updated_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`id`),
  KEY `empleado_id` (`empleado_id`),
  KEY `usuario_pago_id` (`usuario_pago_id`),
  CONSTRAINT `conceptos_ibfk_1` FOREIGN KEY (`empleado_id`) REFERENCES `empleados` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `conceptos_ibfk_2` FOREIGN KEY (`usuario_pago_id`) REFERENCES `usuario_pagos` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;

/*Data for the table `conceptos` */

/*Table structure for table `deducciones` */

DROP TABLE IF EXISTS `deducciones`;

CREATE TABLE `deducciones` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `empleado_id` int(11) NOT NULL,
  `total` varchar(10) NOT NULL,
  `comentarios` text NOT NULL,
  `num_pagos` int(11) NOT NULL,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `updated_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`id`),
  KEY `empleado_id` (`empleado_id`),
  CONSTRAINT `deducciones_ibfk_1` FOREIGN KEY (`empleado_id`) REFERENCES `empleados` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=219 DEFAULT CHARSET=latin1;

