/*Table structure for table `deducciones_detalles` */

DROP TABLE IF EXISTS `deducciones_detalles`;

CREATE TABLE `deducciones_detalles` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `deduccion_id` int(11) NOT NULL,
  `cantidad` varchar(20) NOT NULL COMMENT 'Monto de pago',
  `usuario_pago_id` int(11) DEFAULT NULL COMMENT 'Usuario y hoja de asistencia a la que pertenece',
  `status` tinyint(4) NOT NULL COMMENT '0 => Sin pagar, 1 => Asignado en hoja de pago, 2 => Pagado',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `updated_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`id`),
  KEY `deduccion_id` (`deduccion_id`),
  KEY `usuario_pago_id` (`usuario_pago_id`),
  CONSTRAINT `deducciones_detalles_ibfk_1` FOREIGN KEY (`deduccion_id`) REFERENCES `deducciones` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `deducciones_detalles_ibfk_2` FOREIGN KEY (`usuario_pago_id`) REFERENCES `usuario_pagos` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=1325 DEFAULT CHARSET=latin1;

