/*Table structure for table `retenciones` */

DROP TABLE IF EXISTS `retenciones`;

CREATE TABLE `retenciones` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `empleado_id` int(11) NOT NULL,
  `empresa_id` int(11) NOT NULL COMMENT 'Lugar trabajado',
  `usuario_pago_id` int(11) DEFAULT NULL COMMENT 'Usuario y hoja de asistencia a la que pertenece',
  `importe` varchar(50) NOT NULL COMMENT 'Monto a retener',
  `fecha_inicio` date NOT NULL,
  `fecha_fin` date DEFAULT NULL,
  `num_dias` int(11) NOT NULL,
  `comentarios` text,
  `status` tinyint(4) DEFAULT '0' COMMENT '0 => Pendiente, 1 => Atendido',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `updated_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`id`),
  KEY `empleado_id` (`empleado_id`),
  KEY `empresa_id` (`empresa_id`),
  KEY `usuario_pago_id` (`usuario_pago_id`),
  CONSTRAINT `retenciones_ibfk_1` FOREIGN KEY (`empleado_id`) REFERENCES `empleados` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `retenciones_ibfk_2` FOREIGN KEY (`empresa_id`) REFERENCES `empresas` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `retenciones_ibfk_3` FOREIGN KEY (`usuario_pago_id`) REFERENCES `usuario_pagos` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;

